import ClientDemo from './ClientDemo';
//import Client from './Client';


class ApplicantList extends React.Component {
	constructor(props){
		super(props);
		this.state = {applicants: []}; //array of applicants
		this.clientDemo = new ClientDemo();
		this.clientDemo.applicantList().then(l => this.setState({applicants: l}));
		//this.client = new Client();
		//this.client.clientResult().then(r =>this.setState({applicants:r}));
	}

  render(){
	let applInfo1 = { 
			name: "Almir Omerovic",
			placeOfEmployment: "DCCS, Tuzla",
			addres: "Moluhe,7500 Tuzla",
			};
	let applInfo2 = { 
			name: "Ina Golos",
			placeOfEmployment: "CA, Tuzla",
			addres: "Stupine,7500 Tuzla",
			};
	let applInfo3 = { 
			name: "Arza Grbic",
			placeOfEmployment: "VirginPulse, Tuzla",
			addres: "Slatina,7500 Tuzla",
			};
	let infos = [applInfo1,applInfo2,applInfo3];
	//this.state.applicants = infos;
    return(
      <div className={styles.listDiv}>
        <p> Showing {this.state.applicants.length} results</p>
        {this.state.applicants.map(a => <ApplicantInfo info={a}/>)}
      </div>
    );
  }
}

export default ApplicantList;
